import React from "react";
import { Box, Text, Image, Stack, Link, isOpen } from "@chakra-ui/react";

export default function Logo(props) {
  return (
    <Box {...props}>
        <Stack direction="row" spacing="30px">
            <Image src="/zen_mastercard_logo-2.svg" />      
            <Box display={{ base: isOpen ? "block" : "none", md: "block" }} >
                <Stack direction="row"  mt="5px" >
                    <Link style={{ textDecoration: 'none' }} color="gray.700">Personal</Link>
                    <Text>.</Text>
                    <Link style={{ textDecoration: 'none' }} color="gray.500">Business</Link>
                </Stack>
            </Box>
 
        </Stack>
    </Box>
  );
}
